import requests
import base64
from bs4 import BeautifulSoup


def save_image(url, image):
	response = requests.get(url, verify=False)

	if response.status_code == 200:
		with open(image, 'wb') as f:
			f.write(response.content)


def function():
	try:
		r = requests.get('https://portal.ufpa.br/', verify=False)
		r.raise_for_status()
		soup = BeautifulSoup(r.content, "lxml")

		data = soup.findAll("div", attrs={"class":"carousel-inner"})

		link = []
		img = []
		noticia = []

		for div in data:
			links = div.findAll('a')
			links2 = div.findAll('img')

			for a in links:
				link.append("https://portal.ufpa.br" + a['href'])
				noticia.append(a.get('title'))

			for b in links2:
				img.append(b['src'])


		link2 = [link[0],link[2],link[4],link[6],link[8],link[10]]
		titulo = [noticia[0],noticia[2],noticia[4],noticia[6],noticia[8],noticia[10]]
		all_ = [link2, titulo, img]

		return all_

	except requests.exceptions.RequestException as e:
		return e

